{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/piotrpowroznik/gravimetric-model?scriptVersionId=266442319\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"81fc2ddf","metadata":{"papermill":{"duration":0.003183,"end_time":"2025-10-07T21:54:58.660488","exception":false,"start_time":"2025-10-07T21:54:58.657305","status":"completed"},"tags":[]},"source":["# Gravimetric Model\n","Model of gravity force at the ground surface, simulated in 500x250 grid with nodes spaced 1 meter apart. Model consists of background with density of 3500 kg/m3 and 3 randomly located ore bodies with diameter of 100 meters and density 5500 kg/m3.\n","Model was simulated for nodes 100-400.\n","\n","Gravity anomalies caused by discretized two-dimensional continuous body were calculated using Talwani algorithm modified by Blakely:\n","$$\n","g = 2 \\gamma \\rho \\sum_{n=1}^N \\frac{\\beta_{n}}{1+a_{n}^2}[log{\\frac{r_{n+1}}{r_{n}}} - a_{n}(\\theta_{n+1}-\\theta_{n})]\n","$$\n","\n","$$Where:$$\n","$$\\gamma = 6.67 \\times 10^{-11} \\left[ \\frac{m^3}{kg\\cdot s^2} \\right]$$\n","$$\\rho - node\\ density$$\n","$$r_{n+1}, r_{n} - distance\\ between\\ measurement\\ point\\ and\\ neighboring\\ vertex\\ of\\ rectangle\\ assigned\\ to\\ node$$\n","$$\\theta_{n+1}, \\theta_{n} - angle\\ between\\ x\\ axis\\ and\\ radius\\ designated\\ form\\ measurement\\ point\\ to\\ neighboring\\ vertex$$\n","$$\\alpha_{n} = \\frac{x_{n+1}-x_{n}}{z_{n+1}-z_{n}}$$\n","$$\\beta_{n} = x_{n}-\\alpha_{n}z_{n} $$\n","$$x_{n}, z_{n} - node\\ coordinates$$"]},{"cell_type":"code","execution_count":1,"id":"37f647e4","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:54:58.670057Z","iopub.status.busy":"2025-10-07T21:54:58.667953Z","iopub.status.idle":"2025-10-07T21:54:58.917546Z","shell.execute_reply":"2025-10-07T21:54:58.915738Z"},"papermill":{"duration":0.256468,"end_time":"2025-10-07T21:54:58.919877","exception":false,"start_time":"2025-10-07T21:54:58.663409","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Loading required package: foreach\n","\n"]},{"name":"stderr","output_type":"stream","text":["Loading required package: iterators\n","\n"]},{"name":"stderr","output_type":"stream","text":["Loading required package: snow\n","\n"]}],"source":["library(doSNOW)\n","library(foreach)"]},{"cell_type":"markdown","id":"ccc1fe03","metadata":{"papermill":{"duration":0.002748,"end_time":"2025-10-07T21:54:58.925603","exception":false,"start_time":"2025-10-07T21:54:58.922855","status":"completed"},"tags":[]},"source":["## Define Functions"]},{"cell_type":"code","execution_count":2,"id":"d964f345","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:54:58.967751Z","iopub.status.busy":"2025-10-07T21:54:58.932869Z","iopub.status.idle":"2025-10-07T21:54:58.981834Z","shell.execute_reply":"2025-10-07T21:54:58.980188Z"},"papermill":{"duration":0.055964,"end_time":"2025-10-07T21:54:58.984381","exception":false,"start_time":"2025-10-07T21:54:58.928417","status":"completed"},"tags":[]},"outputs":[],"source":["# Function for calculating distance\n","getR <- function(j, i, k) {\n","  return(sqrt(((j - k)^2) + (i^2)))\n","}\n","\n","# Function for calculating angle\n","getAngle <- function(j, i, k) {\n","  if (k == j) {\n","    return(90.0)\n","  }\n","  \n","  ii <- abs(j - k)\n","  tg <- i / ii\n","  rad <- atan(tg)\n","  deg <- (rad / pi) * 180\n","  return(deg)\n","}"]},{"cell_type":"markdown","id":"12e606db","metadata":{"papermill":{"duration":0.003107,"end_time":"2025-10-07T21:54:58.990419","exception":false,"start_time":"2025-10-07T21:54:58.987312","status":"completed"},"tags":[]},"source":["## Initial Properties"]},{"cell_type":"code","execution_count":3,"id":"7f493b32","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:54:58.999191Z","iopub.status.busy":"20