))\n","  z <- round(50 + runif(1) * (M - 100))\n","  \n","  for (i in 1:M) {\n","    for (j in 1:N) {\n","      if (sqrt((i - z)^2 + (j - x)^2) < 50)\n","        rho[i, j] <- rho2\n","    }\n","  }\n","}\n","\n","# Display the generated model\n","image(t(apply(rho, 2, rev)), asp = 0.5)\n","box()"]},{"cell_type":"markdown","id":"efefa785","metadata":{"papermill":{"duration":0.002978,"end_time":"2025-10-07T21:55:07.560257","exception":false,"start_time":"2025-10-07T21:55:07.557279","status":"completed"},"tags":[]},"source":["## Simulate Model"]},{"cell_type":"code","execution_count":5,"id":"5aba18cf","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:55:07.569513Z","iopub.status.busy":"2025-10-07T21:55:07.568002Z","iopub.status.idle":"2025-10-07T21:58:30.791815Z","shell.execute_reply":"2025-10-07T21:58:30.78896Z"},"papermill":{"duration":203.248324,"end_time":"2025-10-07T21:58:30.81155","exception":false,"start_time":"2025-10-07T21:55:07.563226","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["Time difference of 3.398174 mins"]},"metadata":{},"output_type":"display_data"}],"source":["# Vector for results\n","g <- rep(0, N)\n","\n","# Parallel computation\n","out <- foreach(k = seq(100, 400, 1)) %dopar% {\n","  suma <- 0\n","  \n","  for (i in 1:M) {\n","    for (j in 1:N) {\n","      beta <- (i + 1 - i) / (j + 1 - j)\n","      r <- getR(j, i, k)\n","      r1 <- getR(j, i + 1, k)\n","      z <- r1 / r\n","      logarytm <- log(z)\n","      a <- getAngle(j, i, k)\n","      a1 <- getAngle(j, i + 1, k)\n","      suma <- suma + (rho[i, j] * beta * (logarytm - (a - a1)))\n","    }\n","  }\n","  g <- 2 * gamma * suma\n","}\n","\n","# Stop time measurement\n","stop <- Sys.time()\n","\n","# Print time difference\n","stop - start\n","\n","# Declare matrix\n","m <- matrix(nrow = 10, ncol = 1000, 0)\n","\n","# Assign results to matrix\n","m <- unlist(out)\n","\n","# Release the cluster\n","stopCluster(cl)\n"]},{"cell_type":"markdown","id":"5260d355",